    output                          OUTPUT_AXIS_TVALID,
    input                           OUTPUT_AXIS_TREADY,


    // Incomming FPU Stream	
    input [31:0]                    FPU_IN_AXIS_TDATA,
    input [3:0]                     FPU_IN_AXIS_TKEEP,
    input                           FPU_IN_AXIS_TLAST,
    input                           FPU_IN_AXIS_TVALID,
    output                          FPU_IN_AXIS_TREADY,
    
    // Outgoing FPU Stream  A 
    output [31:0]                   FPU_O_A_AXIS_TDATA,
    output [3:0]                    FPU_O_A_AXIS_TKEEP,
    output                          FPU_O_A_AXIS_TLAST,
    output                          FPU_O_A_AXIS_TVALID,
    input                           FPU_O_A_AXIS_TREADY,

    // Outgoing FPU Stream  B 
    output [31:0]                   FPU_O_B_AXIS_TDATA,
    output [3:0]                    FPU_O_B_AXIS_TKEEP,
    output                          FPU_O_B_AXIS_TLAST,
    output                          FPU_O_B_AXIS_TVALID,
    input                           FPU_O_B_AXIS_TREADY,

    // Outgoing FPU Stream  C 
    output [31:0]                   FPU_O_C_AXIS_TDATA,
    output [3:0]                    FPU_O_C_AXIS_TKEEP,
    output                          FPU_O_C_AXIS_TLAST,
    output                          FPU_O_C_AXIS_TVALID,
    input                           FPU_O_C_AXIS_TREADY

    );  

   

    //ask the output array be cleared
    reg clear_output;
    //output vector array (also used for dot calculations)
    reg [31:0] outputs [0:COLS-1];       

   
    /////////////////////////////////////////////
    //
    // Input Vector Receive +
    // Send-to-FPU Control 
    //
    /////////////////////////////////////////////

    //accept input data from AXI4STREAM input
    reg inbuf_accept;
    //buffer of most recient input
    reg [31:0] inbuf;     
    
    //the FPU is ready to accept AXI4Stream inputs
    wire all_ready = |{FPU_O_A_AXIS_TREADY,FPU_O_B_AXIS_TREADY,FPU_O_C_AXIS_TREADY};
    // Transmit new data to FPU
    reg all_tx;
    // Last signal to FPU
    reg all_last;

    //tracks the row/column location within the weight matrix
    reg [31:0]  i, next_i;
    reg [31:0]  j, next_j;

    //FPU has an 18 cycle input->output delay
    localparam FPU_DELAY = 18; 
    //a timer to track the FPU delays
    localparam TIMER_SZ = $clog2(FPU_DELAY + 1);
    reg [TIMER_SZ-1:0] txrx_timer, next_txrx_timer;

    // STATES
    localparam ST_IDLE      = 0;
    localparam ST_INPUT     = 1;
    localparam ST_ROW       = 2;
    localparam ST_ROW_DELAY  = 3;
    localparam ST_COL_END   = 4;
    localparam ST_SZ = $clog2(ST_COL_END + 1);

    reg [ST_SZ-1:0] state, next_state;

    // input accepts new data when we say so 
    assign INPUT_AXIS_TREADY = inbuf_accept; 

    // FPU output values
    assign FPU_O_A_AXIS_TDATA = weights[i][j]; //[ROW][COL]
    assign FPU_O_B_AXIS_TDATA = inbuf;
    assign FPU_O_C_AXIS_TDATA = outputs[j];
 
    assign FPU_O_A_AXIS_TKEEP = 4'hf;
    assign FPU_O_B_AXIS_TKEEP = 4'hf;
    assign FPU_O_C_AXIS_TKEEP = 4'hf;
    
    assign FPU_O_A_AXIS_TLAST = all_last;
    assign FPU_O_B_AXIS_TLAST = all_last;
    assign FPU_O_C_AXIS_TLAST = all_last;

    assign FPU_O_A_AXIS_TVALID = all_tx;
    assign FPU_O_B_AXIS_TVALID = all_tx;
    assign FPU_O_C_AXIS_TVALID = all_tx;
   
    //sequential block
    always_ff@(posedge clk) begin

        if (rst) begin
            state <= ST_IDLE;
            txrx_timer <= FPU_DELAY;
            i <= 0;
            j <= 0;
            inbuf <= 32'h0;

        end else begin
            state <= next_state;           
            txrx_timer <= next_txrx_timer;
            i <= next_i;
            j <= next_j;
            inbuf <= ( inbuf_accept ? INPUT_AXIS_TDATA : inbuf ); 

        end
    end 
    
    //combinational block                
    always_comb begin        
        next_state = state;
        next_txrx_timer = (txrx_timer > 0 ? txrx_timer - 1 : txrx_timer);
        
        inbuf_accept = 1'h0;
        
        next_i = i; 
        next_j = j;  
        all_tx = 1'h0;    
        all_last = 1'h0;

        clear_output = 1'h0;

        case (state)

            ST_IDLE:  begin
                inbuf_accept = 1'h1;
                //we've got new data
                if (INPUT_AXIS_TVALID ) begin
                    next_state = ST_INPUT;
                end
                
            end
             
            ST_INPUT: begin
                //latch new data, begin dot product     
                if (all_ready) begin
                    all_tx = 1'h1;
                    next_i = 0;
                    next_j = j + 1;
                    next_txrx_timer = FPU_DELAY;
                    next_state  = ST_ROW;
                end
            end
                 
            ST_ROW: begin
                // This state handles a lot of the computation
                // it first processes a single input across a row, 
                // then accepts a new input, and attempts to process the next row. 
                // Due to FPU latency, it may have to stall at the end of short rows 
                // to allow the FPU results to be written back
               
                //if we hit a pipeline glitch on the multiplier
                // reset our timer
                if (~all_ready) begin
                    next_txrx_timer = FPU_DELAY; 
                    
                //within a row, just keep marching across the row
                end else if (j < COLS-1) begin
                    all_tx = 1'h1;
                    next_j = j+1;             
                
                //end of row gets a little tricky, 
                // here we just jump to the next row , and accept new input
                // unless we're hitting the FPU latency, then we jump to a wait state
                end else if ( (j == COLS-1) && (i<ROWS-1)) begin 
                    
                    //we have new data waiting
                    if (INPUT_AXIS_TVALID) begin
                        inbuf_accept = 1'h1;
                        all_tx = 1'h1;
                        all_last = 1'h1;
                        next_i = i + 1;
                        next_j = 0;
                         
                        if (txrx_timer == 0) begin
                            next_state = ST_ROW;
                            next_txrx_timer = FPU_DELAY; //Start on next row
                        end else begin
                            next_state = ST_ROW_DELAY; // wait for FPU to finish
                        end
                        
                    //no new data
                    end else begin
                        ;//wait for new data
                    end
                                
                //we're not at the end of the last row, 
                // jump to the stop state
                end else if ( (j == COLS-1) && (i==ROWS-1) ) begin 
                    all_tx = 1'h1;
                    all_last = 1'h1;
                    
                    //reset counters                                                                                                     
                    next_i = 0;
                    next_j = 0;
                    //let FPU pipeline clear
                    next_txrx_timer = FPU_DELAY;
                    next_state = ST_COL_END;                
                 end
             end
             
             ST_ROW_DELAY: begin
                //just wait for the timer to expire, then jump back to the next row
                if (txrx_timer  == 0) begin 
                    next_state = ST_ROW;
                    next_txrx_timer = FPU_DELAY;
                end
             end
             
             ST_COL_END: begin
                //wait here until the dot product is completely done and the result transmitted
                //once that is done, we can start on a new input
                if (OUTPUT_AXIS_TVALID && OUTPUT_AXIS_TLAST && OUTPUT_AXIS_TREADY) begin 
                    clear_output = 1'h1;
                    next_state = ST_IDLE;
                end
             end    
             
       endcase
    end
    
    /////////////////////////////////////////////
    //
    // Receive-from-FPU Control 
    //
    /////////////////////////////////////////////


    
    reg [31:0] rxi, rxj; 
    wire rx_done; 
    
    assign FPU_IN_AXIS_TREADY = 1'h1;

    always_ff @(posedge clk) begin
    
        if (rst) begin
            rxi <= 0;
            rxj <= 0;
            outputs <= '{default:32'h0}; 

        end else if (clear_output) begin
            // we need to clear the output vector for new incomming data
            outputs <= '{default:32'h0};                            

        end else if (FPU_IN_AXIS_TVALID ) begin
            //the FPU is sending us values, calculate where to put them
            outputs[rxi] <= FPU_IN_AXIS_TDATA;
            rxi <= ( rxi < COLS-1 ? rxi + 1 : 0);        
            rxj <= ( rxi < COLS-1 ? rxj : 
                    (rxj < ROWS-1 ? rxj + 1 : 
                                    0 )); 
        end
    end

    //the FPU just sent us the last value
    assign rx_done = FPU_IN_AXIS_TVALID &&                      
                        (rxi == COLS -1 ) && 
                        (rxj == ROWS - 1);
                        
    /////////////////////////////////////////////
    //
    // Output AXI4Stream Control 
    //
    /////////////////////////////////////////////

           
            
    reg        out_tx, next_out_tx;
    reg [31:0] out_txi, next_out_txi;

    always_ff @(posedge clk) begin
        if (rst) begin
            out_tx  <= 1'h0;
            out_txi <= 0;
        end else begin
            out_tx  <= next_out_tx; 
            out_txi <= next_out_txi; 
        end
    end

    always_comb begin
        next_out_tx = out_tx;
        next_out_txi = out_txi;

        //start case,
        // incriment the output buffer index if the receiver will let us
        if (rx_done)  begin
            next_out_tx = 1'h1;
            next_out_txi = (OUTPUT_AXIS_TREADY ?  out_txi + 1 : out_txi);

        //finish case
        // just sent out last packet, reset
        end else if ((out_tx) && (out_txi == COLS - 1) && (OUTPUT_AXIS_TREADY )) begin
            next_out_tx = 1'h0;
            next_out_txi = 0; 

        //steady state
        // send out a packet and incriment the buffer index
        end else if ((out_tx) && (out_txi != COLS - 1) && (OUTPUT_AXIS_TREADY )) begin
            next_out_tx = 1'h1;
            next_out_txi = out_txi + 1;
        end
    end

    //ANDREW:  just set these to 0's
    assign OUTPUT_AXIS_TDATA = outputs[out_txi];
    assign OUTPUT_AXIS_TKEEP = 4'hf;
    assign OUTPUT_AXIS_TLAST = (out_txi == COLS -1); 
    assign OUTPUT_AXIS_TVALID = ~rst && (rx_done | out_tx);

endmodule
